import React, {Component} from 'react';
import "./Pages.css"
import {Container, Tab, Row, Col, Nav} from "react-bootstrap";

class Dane extends Component {
    render() {
        return (
           <Container>
               <Tab.Container id="ledt-tabs-example" defaultActiveKey="firms" >
                   <Row>
                       <Col sm={3}>
                           <Nav variant="pills" className="flex-column mt-2">
                               <Nav.Item>
                                   <Nav.Link eventKey="firms">Firmy</Nav.Link>
                               </Nav.Item>
                               <Nav.Item>
                                   <Nav.Link eventKey="towary">Towary</Nav.Link>
                               </Nav.Item>
                               <Nav.Item>
                                   <Nav.Link eventKey="magazyny">Magazyny</Nav.Link>
                               </Nav.Item>
                           </Nav>
                       </Col>
                   </Row>
               </Tab.Container>
           </Container>
        );
    }
}

export default Dane;
